import React, { createContext } from 'react';
import ComA from './ComA';

// // useContext Hook in React:

const FirstName = createContext();
const LastName = createContext();

const App = () => {
  return (
    <>
      <FirstName.Provider value={'Shyam Rajput'}>
        <LastName.Provider value={'Gwalior M.P.'}>
          <ComA />
        </LastName.Provider>
      </FirstName.Provider>
    </>
  );
};

export default App;

export { FirstName, LastName }; // context export kiya hai
